import { useHistory } from 'react-router-dom';
import authStore from '../store/authStore';

export const useHistorys = () => {
    const history = useHistory();

    const pushStart = ():void => {
        history.push('/')
    }

    const pushMain = (): void => {
        history.push('/main');
    };

    const pushSignUp = (): void => {
        history.push('/signup');
    };

    const pushLogin = (): void => {
        history.push('/login');
    };

    const pushFindPW = (): void => {
        history.push('/findpw');
    }

    const pushLoggedUser = (): void => {
        const isSignIn = authStore.isSignIn;
        if (isSignIn === true) {
            pushMain();
        } else {
            return;
        }
    }

    return {
        pushStart,
        pushMain,
        pushSignUp,
        pushLogin,
        pushFindPW,
        pushLoggedUser,
    }
}
